package com.bean.vendor;

public class VendorData {
	private String vendorname;
	private String vendormbno;
	private String venderpwd;
	private String item;
	private String itemprice;
	private String city;
	private String pincode;
	public VendorData() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getVendorname() {
		return vendorname;
	}
	public void setVendorname(String vendorname) {
		this.vendorname = vendorname;
	}
	public String getVendormbno() {
		return vendormbno;
	}
	public void setVendormbno(String vendormbno) {
		this.vendormbno = vendormbno;
	}
	public String getVenderpwd() {
		return venderpwd;
	}
	public void setVenderpwd(String venderpwd) {
		this.venderpwd = venderpwd;
	}
	public String getItem() {
		return item;
	}
	public void setItem(String item) {
		this.item = item;
	}
	public String getItemprice() {
		return itemprice;
	}
	public void setItemprice(String itemprice) {
		this.itemprice = itemprice;
	}
	public String getCity() {
		return city;
	}
	public void setCity(String city) {
		this.city = city;
	}
	public String getPincode() {
		return pincode;
	}
	public void setPincode(String pincode) {
		this.pincode = pincode;
	}
	
}
